func generateCustomerComputeconfigs() {
	for _, customer := range customers {
		customerComputeConfigs[customer.WorkspaceID] = CustomerComputeConfig{
			ComputeShare: 0.002,
		}
	}
}

func toLower() {
	for i, customer := range customers {
		customers[i].Name = strings.ToLower(customer.Name)
	}
}

func WaitForComputeConfig() {
	for {
		configReceivedLock.RLock()
		if configReceived {
			configReceivedLock.RUnlock()
			break
		}
		configReceivedLock.RUnlock()
		pkgLogger.Info("Waiting for preparing compute config")
		time.Sleep(time.Second * 1)
	}
}
